    setProjects(["Desenvolvimento Web", "Desenvolvimento Mobile"]);
  });
  return (
    <div className="App">
      <Header title="Projects">
        <ul>
          <li></li>
        </ul>
      </Header>
    </div>
  );
}

export default App;
